import React, { Component } from "react";
import { Form, Container, Button } from "semantic-ui-react";

class App extends Component {
  //WARNING! To be deprecated in React v17. Use componentDidMount instead.
  constructor(props) {
    super(props);
    this.state = {
      response: []
    };
  }

  componentWillMount() {
    fetch("https://api.github.com/repos/octocat/Hello-World/issues", {
      Method: "GET"
    })
      .then(data => {
        return data.json();
      })
      .then(response => {
        console.log("data is::" + JSON.stringify(response));
        this.setState({
          response
        });
      });
  }
  render() {
    return (
      <div className="root">
        <Container>
          <Form>
            <Form.Field required>
              <input placeholder="Repository URL" />
            </Form.Field>
            <Button type="submit">Submit</Button>
          </Form>
        </Container>
      </div>
    );
  }
}

export default App;
